// SPDX-License-Identifier: UNLICENSED
pragma solidity <0.9.0;

/// @title A title that should describe the contract/interface
/// @author The name of the author
/// @notice Explain to an end user what this does
/// @dev Explain to a developer any extra details
contract TrustFund{

    struct Kid{
        uint amount;
        uint maturity;
        bool paid;
    }

    mapping(address =>  Kid) public kids;
    address public admin;

    constructor (){
        admin = msg.sender;
    }

    modifier isAdmin() {
        require(admin == msg.sender, "Not allowed. Only Admin");
        _;
    }

    modifier isKid(address _kid) {
        require(kids[_kid].amount > 0, "Please add child first");
        _;
    }

    modifier isNotKid(address _kid){
        require(kids[_kid].amount == 0, "Kid already added");
        _;
    }

    modifier isWithdrawable(address _kid){
        require(kids[_kid].amount > 0, "Nothing to Withdraw");
        require(kids[_kid].maturity < block.timestamp, "Not Withdrawable");
        require(kids[_kid].paid == false, "Already Paid");
        _;
    }

    event ChildCreated(
        address indexed _kid,
        uint _timeToMaturity,
        uint _amount
    );

    event Deposit(
        address indexed _kid,
        uint _amount
    );

    event Withdraw(
        address indexed _kid,
        uint _amount
    );

    event Remaining(
        address indexed _kid,
        bool isRemaining,
        uint act_stamp,
        uint initial_stamp
    );

/// @notice Explain to an end user what this does
/// @dev  Number 31556952 is factor for years to seconds
/// @param _kid parameter just like in doxygen (must be followed by parameter name)
    function addKid(address _kid, uint _timeToMaturity) external payable isAdmin() isNotKid(_kid) {
        kids[_kid] = Kid(msg.value, _timeToMaturity * 20 + block.timestamp, false);
        emit ChildCreated(_kid, _timeToMaturity, msg.value);
    }


    function deposit(address _kid) external payable isAdmin() isKid(_kid) {
        kids[_kid].amount += msg.value;
        emit Deposit(_kid, msg.value);
    }

    function withdraw() external isWithdrawable(msg.sender){
        Kid storage kid = kids[msg.sender];
        kid.paid = true;
        payable(msg.sender).transfer(kid.amount);
        emit Withdraw(msg.sender, kid.amount);
        delete kids[msg.sender];
    }


    function remainingTime() external returns(uint){
        emit Remaining(msg.sender, kids[msg.sender].maturity > block.timestamp ? true:false, block.timestamp, kids[msg.sender].maturity);
        require(kids[msg.sender].maturity > block.timestamp, "Can already be claimed.");
        return kids[msg.sender].maturity - block.timestamp;
    }

}

